import React from 'react';
import styled from 'styled-components';
import {KineBox} from "../../styles/style";
import {Col, Nav, Row} from "react-bootstrap";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faHome} from "@fortawesome/free-solid-svg-icons";

const Styles = styled.div`
    margin-top: 20px;

    .row {
        margin: 0;
    }
`;


const Patients = [
    {
        name: "Antoine DUPLESSIS"
    },
    {
        name: "Anna MONTEAU"
    },
    {
        name: "Erwan LORIEL"
    },
];

function RenderRecurrentPatients() {
    return (
        Patients.map((item, i) => {
            return (
                <Row>
                    <Col>
                        {item.name}
                    </Col>
                    <Col className="d-flex justify-content-end">
                        <a href="###">Accéder à la fiche patient</a>
                    </Col>
                </Row>
            )
        })
    );
}

function RenderExercices() {
    return (
        <Row>
            <Col>
                Gérard BIENVU
            </Col>
            <Col className="d-flex justify-content-end">
                <a href="###">Accéder à la fiche patient</a>
            </Col>
        </Row>
    );
}


class Home extends React.Component {
    constructor(props) {
        super(props);
        document.title = "Home";
    }

    render() {
        return (
            <Styles>
                <Row>
                    <Col style={{flex: '0 0 500px'}}>
                        <KineBox>
                            <h1>Patients récurrents</h1>
                            <RenderRecurrentPatients/>
                        </KineBox>
                        <KineBox>
                            <h1>Exercices à prescrire</h1>
                            <RenderExercices/>
                        </KineBox>
                    </Col>
                    <Col style={{flex: '0 0 200px'}}>
                        <KineBox>
                            <Row className="justify-content-center">
                                <FontAwesomeIcon icon={faHome} size={"2x"}/>
                            </Row>
                            <Row className="justify-content-center">
                                Accueil
                            </Row>
                        </KineBox>
                    </Col>
                </Row>
            </Styles>
        );
    }
}

export default Home;
